import login_img from "../../../img/login.jpg";
import { Box } from "@material-ui/core";
import MyTextField from "../data/MyTextField";
import Btn from "../../navbar/Btn";
import { Button } from "bootstrap";
const Home = () => {
  return (
    <>
      <div className="bg">
        <div className="clild_div shadow">
          <div className="row">
            <div className="col-6">
              <div className="login_img_div">
                <div
                  className="login_img"
                  style={{ backgroundImage: `url(${login_img})` }}
                ></div>
              </div>
            </div>
            <div className="col-6">
              <div className=" p-5">
                <Box component="form">
                  <MyTextField label="Email Id" type="email" />
                  <MyTextField label="Password" type="password" />
                  <Box component="div">
                    <Btn link="/" btnName="Home" color="inherit" variant="" />
                  </Box>
                </Box>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
